const Navbar = () => {
  const location = useLocation(); // Récupérer l'emplacement actuel

  return (
    <nav className="navbar">
      <h2 className="navbar-logo">DevsOnDeck</h2>
      <div className="navbar-links">
        <Link to="/" className={location.pathname === '/' ? 'active' : ''}>Home</Link>
        <Link to="/login" className={location.pathname === '/login' ? 'active' : ''}>Developer Login</Link>
        <Link to="/signup-developer" className={location.pathname === '/signup-developer' ? 'active' : ''}>Developer SignUp</Link>
        <Link to="/signup-organization" className={location.pathname === '/signup-organization' ? 'active' : ''}>Organization SignUp</Link>
      </div>
    </nav>
  );
}
